import React, { useRef } from "react";
import "../css/common-class.css";
import { Link } from "react-router-dom";
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Pagination } from "swiper/modules";
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";

const HomePage = () => {
  const nextRef = useRef(null);
  const prevRef = useRef(null);
  const paginationRef = useRef(null);

  const products = [
    {
      id: 1,
      image: "assets/product-car.jpg",
      title: "Audi A1 Sportback",
      description: "1.2 TFSI Admired | S- LINE | AIRCO ...",
      year: "2015",
      fuel: "Benzine",
      transmission: "Handmatig",
      price: "€ 96.950,-",
      monthly: "€ 401 per maand",
    },
    {
      id: 2,
      image: "assets/product-car.jpg",
      title: "BMW 3 Serie",
      description: "2.0 Efficient Dynamics | M SPORT | NAVIGATIE ...",
      year: "2018",
      fuel: "Diesel",
      transmission: "Automaat",
      price: "€ 125.000,-",
      monthly: "€ 520 per maand",
    },
    {
      id: 3,
      image: "assets/product-car.jpg",
      title: "Volkswagen Golf",
      description: "1.5 TSI Life | LEDER | CRUISE CONTROL ...",
      year: "2020",
      fuel: "Benzine",
      transmission: "Handmatig",
      price: "€ 89.950,-",
      monthly: "€ 375 per maand",
    },
  ];

  return (
    <main>
      <section className="product-sec">
        <div className="common-wrap">
          <div className="product-sec-wrap">
            <div className="container">
              <div className="product-title">
                <h6>Aanbod</h6>
                <h2>
                  <strong>Onze nieuwste auto's</strong>, klaar voor u.
                </h2>
                <p>
                  Bij Automotive van Lierop hebben we een uitgebreid en divers
                  assortiment occasions op voorraad. Neem alvast een kijkje in
                  ons aanbod!
                </p>
              </div>

              <div className="product-slider">
                <Swiper
                  modules={[Navigation, Pagination]}
                  slidesPerView={1}
                  spaceBetween={10}
                  speed={1000}
                  loop={false}
                  navigation={{
                    nextEl: nextRef.current,
                    prevEl: prevRef.current,
                  }}
                  pagination={{
                    el: paginationRef.current,
                    type: "fraction",
                  }}
                  onBeforeInit={(swiper) => {
                    swiper.params.navigation.nextEl = nextRef.current;
                    swiper.params.navigation.prevEl = prevRef.current;
                    swiper.params.pagination.el = paginationRef.current;
                  }}
                  breakpoints={{
                    320: {
                      slidesPerView: 1,
                      spaceBetween: 5,
                    },
                    768: {
                      slidesPerView: 1,
                      spaceBetween: 10,
                    },
                    992: {
                      slidesPerView: 2,
                      spaceBetween: 15,
                    },
                    1200: {
                      slidesPerView: 3,
                      spaceBetween: 20,
                    },
                  }}
                >
                  {products.map((product) => (
                    <SwiperSlide key={product.id}>
                      <Link to="#">
                        <div className="each-product">
                          <div className="each-product-img position-relative">
                            <img
                              src={product.image}
                              alt={product.title}
                              className="w-100"
                            />
                            <div className="product-plus">
                              <img
                                src="assets/product-plus.svg"
                                alt="View details"
                              />
                            </div>
                          </div>
                          <div className="each-product-text">
                            <h3>{product.title}</h3>
                            <p>{product.description}</p>
                            <ul>
                              <li>
                                <h6>
                                  <strong>Bouwjaar</strong>
                                </h6>
                                <h6>{product.year}</h6>
                              </li>
                              <li>
                                <h6>
                                  <strong>Brandstof</strong>
                                </h6>
                                <h6>{product.fuel}</h6>
                              </li>
                              <li>
                                <h6>
                                  <strong>Transmissie</strong>
                                </h6>
                                <h6>{product.transmission}</h6>
                              </li>
                              <li>
                                <h6>
                                  <strong>{product.price}</strong>
                                </h6>
                                <h6>{product.monthly}</h6>
                              </li>
                            </ul>
                          </div>
                        </div>
                      </Link>
                    </SwiperSlide>
                  ))}
                </Swiper>

                {/* Navigation and Pagination elements */}
                <div ref={nextRef} className="swiper-button-next common-arrow">
                  <img src="assets/next.svg" alt="Next" />
                </div>
                <div ref={prevRef} className="swiper-button-prev common-arrow">
                  <img src="assets/prev.svg" alt="Previous" />
                </div>
                <div ref={paginationRef} className="swiper-pagination"></div>
              </div>

              <div className="product-btn">
                <Link to="#" className="common-btn">
                  Bekijk aanbod
                </Link>
              </div>
            </div>
          </div>
        </div>
      </section>
    </main>
  );
};

export default HomePage;
